import React from 'react';

const CalcBtn = (props) => {

    const BtnHandler = async (event) => {
        console.log(props.city, " ", props.stations[0], " ", props.stations[1]);

        await fetch(`http://localhost4100/query?city=${props.city}&st1=${props.stations[0]}&st2=${props.stations[1]}`)
        .then(res => res.json)
        .then(data => {
            console.log(data.toPath);
        })

    }

    return <button type="submit" onClick={BtnHandler} disabled={props.disabled}>Calculate</button>
}

export default CalcBtn;
